INSERT INTO public.products (id, title, description, image_path, created_at, updated_at, category_name, link) VALUES (1, 'Diabetes', 'Diabetes is a leading cause of blindness, kidney failure, heart attacks, stroke, and amputation of lower limbs. Diabetes burden is strongly linked to metabolic risks and behavioral factors. Algorithms supporting predictive models for the risk of getting diabetes or its complications have been developed using artificial intelligence. It is also capable of identifying diabetes mellitus type based on the data obtained from a patient.', 'https://products.aii.et/assets/img/diabetes-2.webp', '2023-04-26 08:58:18.341317+00', '2023-05-18 01:55:22.936984+00', 'Health', '[{"url": "https://products.aii.et/diabetes-web", "type": "Website"}]');
INSERT INTO public.products (id, title, description, image_path, created_at, updated_at, category_name, link) VALUES (9, 'Coop', 'Coopbankbot is specifically designed for the Cooperative Bank of Oromia, which serves customers in three languages - English, Amharic, and Affan Oromo. It offers a range of services, including delivering information about the bank''s services, collecting customer feedback, assisting in locating ATMs, providing exchange rate information from the bank''s database, and facilitating basic account operations such as checking account balance, requesting a check book, registering disputes over transactions, and reporting lost ATM cards and PIN information. The Coopbankbot is an excellent tool for improving customer experience and streamlining operations, leading to increased efficiency and better business outcomes.', 'https://products.aii.et/assets/img/coop.jpeg', '2023-04-26 09:11:38.717851+00', '2023-05-18 01:57:40.894216+00', 'Financial', '[{"url": "https://t.me/CoopKooBot", "type": "Telegram Bot"}]');
INSERT INTO public.products (id, title, description, image_path, created_at, updated_at, category_name, link) VALUES (10, 'Oromia Bank', 'Oromia Bank Bot is an AI-enabled chatbot that has been specifically designed and deployed for the Bank of Oromia. It provides customers with instant and consistent answers to their queries with endless patience, 24/7. The Oromia Bank Bot delivers a variety of services, including providing information about the bank''s services, collecting customer feedback, and delivering exchange rate information from their database. Furthermore, the chatbot supports three languages, namely English, Amharic, and Affan Oromo, making it more accessible to a wider range of customers.', 'https://products.aii.et/assets/img/Oromia_bank.png', '2023-04-26 09:12:36.509841+00', '2023-05-18 01:58:24.697748+00', 'Financial', '[{"url": "https://t.me/oromiabankbot", "type": "Telegram Bot"}]');
INSERT INTO public.products (id, title, description, image_path, created_at, updated_at, category_name, link) VALUES (4, 'Skin', 'Skin illnesses are one of the most frequent diseases in the world, ranking fourth in terms of non-fatal human sickness. In Ethiopia; Scabies, Papular urticaria, and Atopic dermatitis are the most common with a prevalence of 14.5%, 20.3%, and 19% respectively. The clinical presentations can be difficult to differentiate among the three skin conditions. Additionally underlying causes and their management are so different that it needs a well-trained dermatologist to differentiate between them and give appropriate therapy for each.', 'https://products.aii.et/assets/img/skin.jpg', '2023-04-26 09:03:04.688171+00', '2023-05-18 01:56:10.007278+00', 'Health', '[{"url": "https://products.aii.et/derma", "type": "Website"}]');
