INSERT INTO public.products (id, title, description, image_path, created_at, updated_at, category_name, link) VALUES (11, 'Hibret Bank', 'Hibret Bank Bot is a chatbot that uses AI technology and is specifically designed for Hibret Bank. It is highly efficient and can provide prompt and consistent responses to customer queries 24/7, with a high level of patience. The chatbot offers a variety of services, including providing information about the bank''s products and services, collecting customer feedback, and deliver exchange rate information by retrieving from their database. Furthermore, it is available in three languages, namely English, Amharic, and Affan Oromo, to cater to a wider audience and increase accessibility.', 'https://products.aii.et/assets/img/hibret_bank.png', '2023-04-26 09:13:35.259259+00', '2023-05-18 01:56:55.1443+00', 'Financial', '[{"url": "#", "type": "Telegram Bot"}]');
