INSERT INTO public.products (id, title, description, image_path, created_at, updated_at, category_name, link) VALUES (3, 'Breast cancer', 'In Ethiopia, breast cancer is the most frequently reported cancer among women, and unfortunately, many patients tend to seek medical attention only when the cancer has advanced. To address this issue, it is recommended that women above the age of 40 develop a regular screening habit to enable early detection of breast cancer. However, despite efforts to encourage screening culture, the shortage of radiologists remains a challenge. An AI-based breast cancer detection system can help radiologists to efficiently screen and prioritize cases for further evaluation, ultimately improving early detection rates.', 'https://products.aii.et/assets/img/breast.jpg', '2023-04-26 09:01:49.426967+00', '2023-05-18 01:55:45.941183+00', 'Health', '[{"url": "https://products.aii.et/breast-cancer", "type": "Website"}]');
INSERT INTO public.products (id, title, description, image_path, created_at, updated_at, category_name, link) VALUES (6, 'CoffeeNet', 'Ethiopia is the 10th largest exporter of coffee in the world. Coffee amounts to 34% of all exports in Ethiopia. Coffee leaf disease result in 30% yield loss annually. Early visual identification is one of the best ways to prevent yield loss. But early visual identification is difficult even for trained professionals.', 'https://products.aii.et/assets/img/coffee.jpg', '2023-04-26 09:08:38.149761+00', '2023-05-18 01:57:24.831517+00', 'Agriculture', '[{"url": "https://products.aii.et/assets/apk/coffeenet.apk", "type": "Android"}]');
